import React,{useState} from 'react'
import './controlcentre.css'
import airdrop from './icon/Untitled_Artwork.png'
import focus from './icon/moonk.png'
import bluetooth from './icon/Untitled_Artwork 2.png'
import stage from './icon/stage.png'
import screen from './icon/screen.png'

export default function Controlcentre() {
    const [stageColor, setStageColor] = useState('white');
    const [stageBackground, setStageBackground] = useState('none');

    const handleStageClick = () => {
      if (stageColor === 'white') {
        setStageColor('rgb(191, 0, 234)');
        setStageBackground('white');
      } else {
        setStageColor('white');
        setStageBackground('none');
      }
    };
  return (
    <div>
      <div className='dropcontrolcentre'>
         <div className="l">
         <a><p className='wf'><i className='fa fa-wifi'></i></p>Wi-Fi</a>
         <a><img src={bluetooth} className='blue' />Bluetooth</a>
         <a><img src={airdrop} alt="" className='air' />Airdrop</a>
         </div>
         <div className="r">
         <a ><img  className='focus' src={focus} alt="" />Focus</a>
         </div>
         <div className="x">

         <a className='stage' ><img style={{ color: stageColor, backgroundColor: stageBackground }} onClick={handleStageClick()} src={stage} alt="" />Stage Manager</a>
         </div>
         <div className="y">

         <a className='screen'><img src={screen} alt="" />Screen Mirroring</a>
         </div>
          <div className="bright">
          <a>Display</a>
          <input  type="range" name="" id="" />
          </div>
         <div className="volume">
         <a>Sound</a>
         <input  type="range" name="" id="" />
         </div>
        </div>
    </div>
  )
}
